import * as React from 'react';
import {View, Text} from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs'; 

//screens
import GroceryList from './navigation/screens/GroceryList';
import Inventory from './navigation/screens/Inventory';
import Settings from './navigation/screens/Settings';
import StartScreen from './navigation/screens/RegisterScreen';
import LoginScreen from './navigation/screens/LoginScreen';
import RegisterScreen from './navigation/screens/RegisterScreen';

//screen names 
const GroceryName = 'Grocery';
const InventoryName = 'Inventory';
const SettingsName = 'Settings';
const StartName = 'Start';

const Tab = createBottomTabNavigator();
const Stack = createStackNavigator();

function Home(){
  <Tab.Navigator 
            initialRouteName={LoginName}
            >
            <Tab.Screen name={GroceryName} component={GroceryList} />
            <Tab.Screen name={InventoryName} component={Inventory} />
            <Tab.Screen name={SettingsName} component={Settings} />
            <Tab.Screen name ={StartName} component = {StartScreen} />
        </Tab.Navigator>
}

export default function App() {
  return (
      <NavigationContainer>
        <Stack.Navigator
        initialRouteName = "StartScreen"
        screenOption = {{
          headerShown: false,
        }}
        >
          <Stack.Screen name="StartScreen" component={StartScreen} />
          <Stack.Screen name="LoginScreen" component={LoginScreen} />
          <Stack.Screen name="RegisterScreen" component={RegisterScreen} />
        </Stack.Navigator>
        
      </NavigationContainer>

  );
}
